The easiest way to run a single test is to rely on the framework by defining a test case with the RX_TEST_CASE macro, writing a test in there using one of the assertion macros available, and finally running that test case by calling the rx_main function: #include <rexo.h> /* Define a new test case 'bar' that is part of an implicit test suite 'foo'. The main purpose of the `RX_TEST_CASE` macro is to declare the test case's function.
*/
RX_TEST_CASE(foo, bar)
{ /* Run a single test that compares two integer values for equality. */ RX_INT_REQUIRE_EQUAL(2 * 3 * 7, 42);
} int
main(int argc, const char **argv)
{ /* Execute the main function that runs the test cases found. */ return rx_main(0, NULL, argc, argv) == RX_SUCCESS ? 0 : 1;
} Note: Setting the test_cases argument from the rx_main function to NULL means that the function is responsible for finding all the test cases that were defined using the framework 's automatic registration feature. Note: In the example above, the RX_TEST_CASE macro implicitly creates a test suite named foo .

