When using the framework and its automatic registration feature, configuring test cases is done by passing optional arguments to the RX_TEST_CASE and/or RX_TEST_SUITE macros. #include <stdio.h> #include <rexo.h> RX_TEST_SUITE(foo, .skip = 1); /* Inherit the skip option from the test suite 'foo'. */
RX_TEST_CASE(foo, bar)
{ printf("this does NOT print\n");
} /* Override the skip option to run this specific test case. */
RX_TEST_CASE(foo, baz, .skip = 0)
{ printf("this does print!\n");
} int
main(int argc, const char **argv)
{ return rx_main(0, NULL, argc, argv) == RX_SUCCESS ? 0 : 1;
} This example explicitly creates a test suite named foo with the skip option enabled. Any option defined on a test suite is to be inherited by all the test cases of that test suite, unless overidden by a specific test case like here with baz . Note: For a list of all the runtime options available, see the rx_test_case_config struct.

