Often times a dataset is required to be prepared in advance, before test cases should be run. Like with every other xUnit-like frameworks, Rexo allows this do be done using fixtures. You can define a new fixture through the RX_FIXTURE macro with optional set up and tear down functions, then reference this fixture by setting the fixture option on the RX_TEST_CASE macro. #include <rexo.h> /* Data structure to use at the core of our fixture. */
struct foo_data { const char *value;
}; /* Initialize the data structure. Its allocation is handled by Rexo. */
RX_SET_UP(foo_set_up)
{ struct foo_data *data; /* The macro `RX_DATA` references our data as a pointer to `void` that needs to be cast to the correct type before being used. */ data = (struct foo_data *)RX_DATA; /* Initialize it! */ data->value = "world!"; /* Let Rexo know that everything went well. */ return RX_SUCCESS;
} /* Define the fixture. */
RX_FIXTURE(foo_fixture, struct foo_data, .set_up = foo_set_up); RX_TEST_CASE(foo, bar, .fixture = foo_fixture)
{ struct foo_data *data; /* Here again, casting needs to be node before operating on the data. */ data = (struct foo_data *)RX_DATA; /* Run a string equality test that will fail since 'Hello' isn't equal to the value 'world!' that we initialized earlier. */ RX_STR_REQUIRE_EQUAL("Hello", data->value);
} int
main(int argc, const char **argv)
{ return rx_main(0, NULL, argc, argv) == RX_SUCCESS ? 0 : 1;
} Fixture data can be accessed at any time using the RX_DATA macro.

