Configurations that applies globally are sometimes best done once and for all during the compilation step. Rexo offers a set of macros that, for example, allows redefining the malloc and assert functions to use, or to set global flags: #include <stddef.h>
#include <stdio.h>
#include <stdlib.h> /* Define a custom `malloc` function. */
void *
my_malloc(size_t size)
{ printf("something worth %ld bytes is being allocated\n", size); return malloc(size);
} /* Override the default `malloc` function used by Rexo with ours. */
#define RX_MALLOC my_malloc /* Override the default `assert` macro used by Rexo. */
#define RX_ASSERT(x) \ (void)( \ (x) \ || (printf(__FILE__ ":%d: assertion `" #x "` failed\n", __LINE__), 0) \ || (abort(), 0)) /* Force Rexo's compatibility with C89. */
#define RX_ENABLE_C89_COMPAT /* Proceed with including Rexo and writing tests as usual. */ #include <rexo.h> RX_TEST_CASE(foo, bar)
{ RX_INT_REQUIRE_EQUAL(2 * 3 * 7, 42);
} int
main(int argc, const char **argv)
{ return rx_main(0, NULL, argc, argv) == RX_SUCCESS ? 0 : 1;
} Note: The use of #include <rexo.h> needs to come after the definition of any compile-time option. Note: For a list of all the compile-time options available, see the Compile-Time Configuration page.

