If you would like to not make use of the framework 's automatic registration feature, it is possible to register everything explicitly in the same way as most C unit testing frameworks offer: #include <rexo.h> struct foo_data { int value;
}; enum rx_status
foo_set_up(struct rx_context *RX_PARAM_CONTEXT, void *RX_PARAM_DATA)
{ struct foo_data *data; /* Suppress the â€˜defined but not usedâ€™ compiler warning. */ (void)RX_PARAM_CONTEXT; data = (struct foo_data *)RX_DATA; data->value = 123; return RX_SUCCESS;
} void
foo_bar(struct rx_context *RX_PARAM_CONTEXT, void *RX_PARAM_DATA)
{ struct foo_data *data; data = (struct foo_data *)RX_DATA; RX_INT_REQUIRE_EQUAL(data->value, 123);
} static const struct rx_test_case test_cases[] = { { /* First test case's definition. */ "foo", /* Name of the test suite. */ "bar", /* Name of the test case. */ foo_bar, /* Function to run. */ { /* Test case's configuration. */ 0, /* Option 'skip'. */ { /* Option 'fixture'. */ sizeof(struct foo_data), /* Size of the data in bytes. */ { /* Fixture's configuration. */ foo_set_up, /* Function to initialize the fixture. */ NULL /* Function to clean up the fixture. */ } } } } }; /* Retrieve the number of test cases to run. */
static const size_t test_case_count = sizeof(test_cases) / sizeof(test_cases[0]); int
main(int argc, const char **argv)
{ /* Explicitly pass the test cases to be run. */ return rx_main(test_case_count, test_cases, argc, argv) == RX_SUCCESS ? 0 : 1;
} Note: See the rx_test_case struct. Note: The function parameters struct rx_context * and void * are required to be respectively named using the RX_PARAM_CONTEXT and RX_PARAM_DATA macros. Note: Alternatively, the data parameter can be defined with its actual type instead of void *, thus removing the need to cast the data within the functions. Although this approach requires casting function pointers, which is not standard compliant and hence not used in the implementation of Rexo, in practice the behaviour is well-defined for the common platforms.

