The automatic registration of such C++ frameworks is commonly achieved by defining a function to run for each test case and by having these functions added to a global array that can then be iterated over at runtime, as demonstrated in this snippet: /* C++ only! */
#include <stdio.h> struct test_case { const char *name; void (*run_fn)();
}; struct test_case *test_cases[128];
static int next_test_case_idx = 0; static int
register_test_case(struct test_case *test_case)
{ test_cases[next_test_case_idx++] = test_case; return 0;
} #define TEST_CASE(name) \ static void name(); \ struct test_case test_case_##name = {#name, name}; \ int dummy_##name = register_test_case(&test_case_##name); \ static void name() TEST_CASE(foo)
{ printf("Hello, world, I'm foo!\n");
} TEST_CASE(bar)
{ printf("Hello, world, I'm bar!\n");
} int
main(void)
{ int i; for (i = 0; i < next_test_case_idx; ++i) { printf("running `%s`\n", test_cases[i]->name); test_cases[i]->run_fn(); } return 0;
} By the time that this program iterates over the test cases in main, the two test cases foo and bar have already been added to the array through a call to the register_test_case function.

