Running the previous snippet is possible in C++ because it is able to call any function before executing main. Alas, this doesn't work in C due to additional constraints to the language: #include <stdio.h> static int
get_foo()
{ return 123;
} static int foo = get_foo(); /* only allowed in C++ :( */ int
main(void)
{ printf("%d\n", foo); return 0;
} Without any standard way of providing an automatic registration framework in C, most minimalist samples from conventional frameworks look like something along these lines: #include <stdlib.h>
#include <unittestframework.h> struct my_string { int length; const char *value;
}; static int
set_up(void **data)
{ struct my_string *s; s = (struct my_string *)malloc(sizeof *s); if (s == NULL) { return 1; } s->length = 13; s->value = "hello, world!"; *data = (void *)s; return 0;
} static void
tear_down(void *data)
{ free(data);
} static void
test_foo(void *data)
{ struct my_string *s; s = (struct my_string *)data; ASSERT_INT_EQUAL(s->length, 13);
} static void
test_bar(void *data)
{ struct my_string *s; s = (struct my_string *)data; ASSERT_STR_EQUAL(s, "hello, world!");
} static const struct test_cases cases[] = { {"foo", test_foo}, {"bar", test_bar},
}; static const struct test_suite suites[]= { {"suite", sizeof cases / sizeof cases[0], cases, set_up, tear_down},
}; int
main(void)
{ return run(sizeof suites / sizeof suites[0], suites);
} Not only is this a lot of boilerplate but it is also fairly error-prone since it is easy to add new tests while forgetting to register them further down the line.

