One solution for C is to use a compiler extension that is expected to be available for all compilers in a form or another and that provides custom memory sections . Custom memory sections allow grouping related objects in the same memory space and to then iterate over them at runtime. As an example, this is the gist of how such an implementation might look like for the GNU-compliant compilers: #include <stdio.h> struct test_case { const char *name;
}; const struct test_case test_case_foo = {"foo"};
const struct test_case test_case_bar = {"bar"}; const struct test_case *__start_rxcases;
const struct test_case *__stop_rxcases; __attribute__((section("rxcases")))
const struct test_case *test_case_foo_ptr = &test_case_foo; __attribute__((section("rxcases")))
const struct test_case *test_case_bar_ptr = &test_case_bar; int
main(void)
{ const struct test_case **it; for (it = &__start_rxcases; it < &__stop_rxcases; ++it) { if (*it != NULL) { printf("found `%s`\n", (*it)->name); } } return 0;
} And here's the equivalent implementation, adapted to MSVC: #include <stdio.h> struct test_case { const char *name;
}; const struct test_case test_case_foo = {"foo"};
const struct test_case test_case_bar = {"bar"}; __pragma(section("rxcases$a", read))
__pragma(section("rxcases$b", read))
__pragma(section("rxcases$c", read)) __declspec(allocate("rxcases$a"))
const struct test_case *section_begin = NULL; __declspec(allocate("rxcases$c"))
const struct test_case *section_end = NULL; __declspec(allocate("rxcases$b"))
const struct test_case *test_case_foo_ptr = &test_case_foo; __declspec(allocate("rxcases$b"))
const struct test_case *test_case_bar_ptr = &test_case_bar; int
main(void)
{ const struct test_case **it; for (it = &section_begin + 1; it < &section_end; ++it) { if (*it != NULL) { printf("found `%s`\n", (*it)->name); } } return 0;
}

