When it comes to setting a bunch of options at once, the most user-friendly approach is usually to define a struct where 0 (or NULL) corresponds to the default value for each field, and to let the users initialize instances of that struct by only setting the fields that need to have their value changed from the defaults through. This is exactly what the designated initializer syntax introduced with C99 offers: struct config { const char *foo; int bar; double baz;
}; /* Only setting the bar field leaves foo and baz to 0. */
struct config my_config = {.bar = 123}; Despite Rexo's intention of supporting C89 and C++ when both languages are not compatible with the designated initializer syntax, it was still a strong design goal to provide a similar approach for setting options. This is done by using variadic macros where the optional arguments start with a dot character: MY_MACRO(arg_1, arg_2, .option_1 = 123, .option_2 = "abc");

